import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import GitHubIcon from '@material-ui/icons/GitHub';
import TitleIcon from '@material-ui/icons/Title';


const useStyles = makeStyles((theme) => ({
    LinkStyles: {
        flex: 1,
        color: 'rgb(228, 130, 74)',
        marginTop: '30px',
        fontSize: '80px',
        marginLeft: '0px',
        marginRight: '10px',
        cursor: 'pointer'
    },

    root: {
        boxShadow: "none",
        backgroundColor: "#000000",
        height: '70px',
        borderTop: '2px solid rgb(228, 130, 74)',
        width: '90%',
        marginBottom: '40px',
        margin: '0 auto'
    },

    titleIcon: {
        color: 'rgb(228, 130, 74)',
        marginRight: '10px',
        marginTop: '30px',
        fontSize: '50px',
        border: 'solid 2px rgb(228, 130, 74)'

    },
    
}))

const Footer = () => {
    const classes = useStyles();
    return(
        <AppBar position="static" className={classes.root} id="navBar">
            <Toolbar>
                <a className={classes.LinkStyles}><GitHubIcon className={classes.IconStyles} /></a>
                <TitleIcon className={classes.titleIcon}/>
            </Toolbar>
        </AppBar>
    )
}

export default Footer;
